import Nav from './Nav';
import Head from 'next/head'

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div style={layoutStyle}>
    <Head>
      <title>Next Foundation</title>
    </Head>
    <Nav />
    {props.children}
  </div>
);

export default Layout;
